import './App.css';
import { Link, Route, Routes } from 'react-router'

function App() {
  return (
    <>

      <main>
        <section id='intro'></section>
        <section id='recent posts'>
          <h1>Most Recent Posts</h1>
          <article>
            <img></img>
            <h2>April 9 2025</h2>
            <h1></h1>
            <Link>Continue Reading...</Link>
          </article>
        </section>
      </main>

    </>
  );
}

export default App;
